ints_play";i:0;s:15:"vod_points_down";i:0;s:8:"vod_hits";i:928;s:12:"vod_hits_day";i:610;s:13:"vod_hits_week";i:395;s:14:"vod_hits_month";i:231;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:605;s:8:"vod_down";i:924;s:9:"vod_score";s:3:"9.0";s:13:"vod_score_all";i:4734;s:13:"vod_score_num";i:526;s:8:"vod_time";i:1566739220;s:12:"vod_time_add";i:1564036126;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:1565600493;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1791:"日本TBS电视台从1996年就开始摄制的世界遗产大型系列纪录片，每周播放一期，迄今为止已经连续播出465集&quot;世界遗产是属于地球和人类的，保护世界遗产业已成为21世纪最大的国际合作。或遭风化或受人为破坏，遗产也许无法永存，而借助数码技术，一旦凝固于影像，便可以高清晰的再现，永久保存。&nbsp;　　&quot;几乎每个摄制人员都曾有与死神擦身而过的情况，有时我们感叹能够活下来简直是一件不可思议的事。&quot;昔日的艰辛，今天在村国弘（日本TBS电视台资深制片人）看来已成了笑谈，但实际上，在这一张张精彩的照片后有着大量不为人知的艰辛乃至危险。&nbsp;　　&quot;提起世界遗产，人们往往想到的是中国的故宫、长城，埃及的金字塔，但实际上还有很多不为人所知的地方，比如创立于1930年的跨越大西洋和瑞典的一个通讯广播站，日本原爆点所在地，法国、匈牙利、波兰的葡萄园，有的甚至是人迹罕至、举步维艰。&quot;村国弘回忆，一个摄影组到柬埔寨某地，后来才知道下车的地方就埋着地雷，如果爆炸后果不堪设想；在非洲的森林里，一个导演被毒虫咬了，差点送了命；一个工作人员在航拍时差点从飞机上掉下去……&nbsp;　　&quot;且不说每个小组需要搬运的摄影器材就有500多公斤，光是拍摄本身就充满困难，比如有的山峰很高，攀越非常艰难；像长城这样的世界遗产，不仅要拍摄它本身，还要表现出它背后的文化、传统；挪威的一个小木教堂，怎么就这一个简单的对象拍出30分钟的纪录片，也颇费周折。&quot;村国弘说。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1158:"第01集$https://www.183757.com/20190725/1DIpM4zO/index.m3u8#第02集$https://www.183757.com/20190725/YqrBt2eb/index.m3u8#第03集$https://www.183757.com/20190725/7LFk9rPe/index.m3u8#第04集$https://www.183757.com/20190725/Rh0xXbay/index.m3u8#第05集$https://www.183757.com/20190725/hlLHnI2d/index.m3u8#第06集$https://www.183757.com/20190725/5J7bd2Yu/index.m3u8#第07集$https://www.183757.com/20190725/QxRklzhN/index.m3u8#第08集$https://www.183757.com/20190725/WecrOu5Y/index.m3u8#第09集$ht